def find_maximum_xor(nums):
    ans = 1
    for bit in range(31, -1, -1):
        ans = (ans << 1) + 1
        pre = set()
        for n in nums:
            p = n >> bit & ans
            if p in pre:
                break
            pre.add(ans - p)
        else:
            ans -= 1
    return ans

